#define ALU_VEC_SIZE sizeof(avec)/sizeof(avec[0])

static int results[ALU_VEC_SIZE];


static struct operands
{
	int a;
	int b;
	int op;
};


void configtbALU(struct tbconfig *tbcfg)
{
	tbcfg->source1 = avec;
	tbcfg->source2 = bvec;
	tbcfg->sourcelen = sizeof(avec);
	tbcfg->resultslen = sizeof(avec);
}

static void getopends(struct operands *ope,int i)
{
	ope->a = avec[i];
	ope->b = bvec[i];
	ope->op = (ope->a & 0x30000)>>16;
	ope->op = (ope->b & 0x30000)>>14 | ope->op;

	ope->a = ope->a & 0xfffcffff;
	ope->b = ope->b & 0xfffcffff;
}
static int add(int a,int b)
{
	return a + b;
}

static int sub(int a,int b)
{
	return a - b;
}

static int sltu(int a,int b)
{
	unsigned int a1 = (unsigned int) a;
	unsigned int b1 = (unsigned int) b;
	return (a1<b1)? 1:0 ;
}

static int a(int a,int b)
{
	return a;
}

static int b(int a,int b)
{
	return b;
}

static int ssl(int a,int b)
{
	return a << (b&0x1f);
}

static int srl(int a,int b)
{
	unsigned int a1 = (unsigned int) a;
	unsigned int b1 = (unsigned int) b;
	return a1 >> (b1&0x1f);
}

static int or(int a,int b)
{
	return a | b;
}

static int and(int a,int b)
{
	return a & b;
}

static int xor(int a,int b)
{
	return a ^ b;
}

static int stl(int a,int b)
{
	return (a<b)? 1:0 ;
}

static int sra(int a,int b)
{
	return a >> (b&0x1f);
}

static int clear(int a,int b)
{
	int mask = (~a)&0xffffffff;
	return b & mask;
}

static int nop(int a,int b)
{
    return 0;
}

static int (*funcs[])() =
	{
		add,
		ssl,
		stl,
		sltu,
		xor,
		srl,
		or,
		and,
		sub,
		nop,
		stl,
		sltu,
		a,
		sra,
		b,
		clear
	};

static char *(funcsnames[]) =
	{
		"add",
		"ssl",
		"stl",
		"sltu",
		"xor",
		"srl",
		"or",
		"and",
		"sub",
		"nop",
		"stl",
		"sltu",
		"a",
		"sra",
		"b",
		"clear"
	};

int ALU(int a, int b, int op)
{
	op = op & 0xff;
	return funcs[op](a,b);
}


int genresultsALU()
{
	struct operands ope;
	int Nuses[16];
	for (int i = 0; i<16;i++) Nuses[i] = 0;
	int i;
	for(i=0; i<ALU_VEC_SIZE; i++)
	{

		getopends(&ope,i);
		Nuses[ope.op]++;
		results[i] =  ALU(ope.a,ope.b,ope.op);
	}
	for (int i = 0; i<16;i++)
	{
		xil_printf("Operation[%d] : %s, #: %d\r\n",i,funcsnames[i],Nuses[i]);
	}
	return i;
}


//Return the number of not disagreement
int CheckResultsALU(int *vec2check)
{
	int nerrors[16];

	for (int i = 0; i<16;i++) nerrors[i] = 0;
	int cnt = 0;
	int expected,real;
	struct operands ope;
	for (int i = 0; i<ALU_VEC_SIZE-1;i++)
	{
		expected = results[i];
		real = vec2check[i+1];
		if(expected!=real)
		{
			cnt++;
			getopends(&ope,i);
			nerrors[ope.op]++;
			xil_printf("--- mismatch at (%d), expected %x, real %x [!]operand=%s,A=%x,B=%x\r\n",i,expected,real,funcsnames[ope.op],ope.a,ope.b);
		}
	}

	for (int i = 0; i<16;i++)
	{
		xil_printf("Operation[%d]: %s, Errors: %d\r\n",i,funcsnames[i],nerrors[i]);
	}
	return cnt;
}

